var tipuesearch = {"pages": [{'title': 'stage1-ag4', 'text': '題目:挖土機手臂 \n 小組網站: https://40823104.github.io/stage1-ag4/content/index.html \n 組員網站: https://40823101.github.io/cd2021/content/index.html', 'tags': '', 'url': 'stage1-ag4.html'}, {'title': 'w16', 'text': '1.w16雲端各檔案: \n https://drive.google.com/drive/folders/1lXGOcebYsqjznBxOJzrcsG8JJKB6s8HH?usp=sharing \n 2.影片 \n \n \n \n \n \n 心得:這是第一次使用onshape畫圖，覺得如果是簡易灀面畫會非常的方便，而且不向solidworks轉出stl檔時沒辦法組合圖轉出，這是十分方便的點。而這次使用coppeliasim後，雖然還是不夠熟悉，也因為之前大部分所負責的都以繪圖及網站居多，雖然在程式上出現了許多問題，但是我會多去看看同學的飲片，來看出自的問題何在，不過通過這次我相信會比上一次更佳的熟練，也謝謝老師的教學及同學們的幫忙', 'tags': '', 'url': 'w16.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};